import React from 'react';

const RecipeCard = ({ recipe }) => {
  return (
    <div>
      <h3>{recipe.name}</h3>
      <p>Prep Time: {recipe.prepTime} mins</p>
      <button>View More</button>
    </div>
  );
};

export default RecipeCard;
